import React from 'react';
import './ResultPage2.css';
import { useLocation, useNavigate } from 'react-router-dom';
import logo from './assets/sonar-logo.png';

const ResultPage2 = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const { result, sectorResults } = location.state || {};

    const handleGoBack = () => {
        navigate('/');
    };

    return (
        <div className="result-page2">
            <div className="menu-bar">
                <div className="logo-container" onClick={handleGoBack}>
                    <img src={logo} alt="Sonar Logo" className="homepage-logo" />
                </div>
            </div>
            <div className="result-container fade-in">
                <h2 className="result-title">{result?.filename}</h2>
                <h3>Relevant Sections for: {sectorResults?.sector}</h3>
                <table className="result-table">
                    <thead>
                        <tr>
                            <th>Section Name</th>
                            <th>Pages</th>
                            <th>Relevance Score</th>
                        </tr>
                    </thead>
                    <tbody>
                        {sectorResults && sectorResults.map((item, index) => (
                            <tr key={index}>
                                <td>{item.section}</td>
                                <td>{item.pages}</td>
                                <td>{item.score.toFixed(4)}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
                <button className="back-button" onClick={handleGoBack}>Back</button>
            </div>
        </div>
    );
};

export default ResultPage2;
